import React from 'react'
import { Link } from 'react-router-dom'

function Navbar() {
  return (
    <div>Navbar
        
          <Link to='/'>home</Link>
          <Link to='/contact'>contact</Link>
          <Link to='/faq'>Faq</Link>
          <Link to='/about'>about</Link>
      

    </div>
  )
}

export default Navbar
